struct Player {
  int num;
  int location;
  int move;
  int win;
  short int colour;
  int dice;
  int fall;
  int climb;
  int ret_location;
};

struct audio_t {
  volatile unsigned int control;
  volatile unsigned char rarc;
  volatile unsigned char ralc;
  volatile unsigned char warc;
  volatile unsigned char walc;
  volatile unsigned int ldata;
  volatile unsigned int rdata;
};

volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
volatile int *KEYS = (int *)0xFF200050;
volatile int *PS2_ptr = (int *)0xFF200100;
struct audio_t *const audiop = ((struct audio_t *)0xff203040);

int main(void) {
  // declare other variables(not shown)
  int edge_cap;
  int edge_cap_reset = 0b1111;
  int turn = 0;
  int start = 1;
  int delay_on = 0;

  struct Player p1;
  p1.num = 1;
  p1.location = 1;
  p1.move = 0;
  p1.win = 0;
  p1.colour = 0xFFFF;
  p1.dice = 0;
  p1.fall = 0;
  p1.climb = 0;
  p1.ret_location = 0;

  struct Player p2;
  p2.num = 2;
  p2.location = 1;
  p2.move = 0;
  p2.win = 0;
  p2.colour = 0x0000;
  p2.dice = 0;
  p2.fall = 0;
  p2.climb = 0;
  p2.ret_location = 0;

  unsigned char byte1 = 0;
  unsigned char byte2 = 0;
  unsigned char byte3 = 0;

  int PS2_data, RVALID;

  /* set front pixel buffer to Buffer 1 */
  *(pixel_ctrl_ptr + 1) =
      (int)&Buffer1;  // first store the address in the  back buffer
  /* now, swap the front/back buffers, to set the front buffer location */
  wait_for_vsync();
  /* initialize a pointer to the pixel buffer, used by drawing functions */
  pixel_buffer_start = *pixel_ctrl_ptr;
  clear_screen();  // pixel_buffer_start points to the pixel buffer

  /* set back pixel buffer to Buffer 2 */
  *(pixel_ctrl_ptr + 1) = (int)&Buffer2;
  pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // we draw on the back buffer
  clear_screen();  // pixel_buffer_start points to the pixel buffer

  while (1) {
    draw_board();

    if (p1.win) {
      audio_playback_mono(win, win_n, 1, 1);
    }
    if (p2.win) {
      audio_playback_mono(win, win_n, 1, 1);
    }

    if (start) {
      draw_start();
      p1.location = 1;
      p1.win = 0;
      p2.location = 1;
      p2.win = 0;
      audio_playback_mono(start, start_n, 1, 1);
    }
    draw_circle(p1.location, p1.colour);
    draw_circle(p2.location, p2.colour);
    edge_cap = *(KEYS + 3);
    PS2_data = *(PS2_ptr);         // read the Data register in the PS/2 port
    RVALID = (PS2_data & 0x8000);  // extract the RVALID field

    if (RVALID != 0 && !p1.win && !p2.win && !p1.fall && !p1.climb &&
        !p2.fall && !p2.climb && p2.move == 0 && p1.move == 0) {
      /* always save the last three bytes received */
      byte1 = byte2;
      byte2 = byte3;
      byte3 = PS2_data & 0xFF;
    }
    if ((byte2 == 0xAA) && (byte3 == 0x00)) {
      // mouse inserted; initialize sending of data
      *(PS2_ptr) = 0xF4;
    }
    if (byte3 == 0x2D) {
      start = 0;
      byte3 = 0;
      // if (edge_cap == 0b0001) {
      if (!p1.win && !p2.win && !p1.fall && !p1.climb && !p2.fall &&
          !p2.climb) {
        if (p2.move == 0 && p1.move == 0) {
          delay_on = 1;
          turn = ~turn;
          audio_playback_mono(dice_audio, dice_n, 1, 1);
          if (turn) {
            p1.dice = get_dice();
            p1.move = p1.dice;
            draw_dice_image_left(p1.dice);
          } else {
            p2.dice = get_dice();
            p2.move = p2.dice;
            draw_dice_image_right(p2.dice);
          }
        }
      }
    }
    if (!(p2.move == 0 && p1.move == 0) && !delay_on && !p1.fall && !p1.climb &&
        !p2.fall && !p2.climb) {
      audio_playback_mono(move, move_n, 1, 1);

      if (turn) {
        p1.location = p1.location + 1;
        p1.move = p1.move - 1;
        draw_dice_image_left(p1.dice);
      } else {
        p2.location = p2.location + 1;
        p2.move = p2.move - 1;
        draw_dice_image_right(p2.dice);
      }
      if (p1.location >= 100) {
        p1.move = 0;
        p1.win = 1;
        p1.location = 100;
        start = 1;
      }
      if (p2.location >= 100) {
        p2.move = 0;
        p2.win = 1;
        p2.location = 100;
        start = 1;
      }
      delay(1000);
    } else if ((p1.climb || p2.climb) && !delay_on) {
      audio_playback_mono(climb, climb_n, 1, 1);
      if (turn) {
        p1.location = p1.ret_location;
        p1.climb = 0;
      } else {
        p2.location = p2.ret_location;
        p2.climb = 0;
      }
    } else if ((p1.fall || p2.fall) && !delay_on) {
      audio_playback_mono(fall, fall_n, 1, 1);

      if (turn) {
        p1.location = p1.ret_location;
        p1.fall = 0;
      } else {
        p2.location = p2.ret_location;
        p2.fall = 0;
      }
    }
    *(KEYS + 3) = edge_cap_reset;
    wait_for_vsync();  // swap front and back buffers on VGA vertical sync
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // new back buffers

    if (delay_on) {
      delay(5000);
      delay_on = 0;
    }

    if (p1.move == 0) {
      p1.ret_location = climb_location(p1.location);
      if (p1.ret_location != 0) {
        p1.climb = 1;
      } else {
        p1.ret_location = fall_location(p1.location);
        if (p1.ret_location != 0) {
          p1.fall = 1;
        }
      }
    }

    if (p2.move == 0) {
      p2.ret_location = climb_location(p2.location);
      if (p2.ret_location != 0) {
        p2.climb = 1;
      } else {
        p2.ret_location = fall_location(p2.location);
        if (p2.ret_location != 0) {
          p2.fall = 1;
        }
      }
    }
  }
}

void draw_board() {
  for (int y = 0; y < HEIGHT; y++) {
    for (int x = 0; x < WIDTH; x++) {
      short int color =
          image[y * WIDTH + x];  // Calculate index for one-dimensional array
      plot_pixel(x, y, color);
    }
  }
}

