void draw_circle(int location, short int colour) {
  int x, y;
  if (location == 100) {
    x = 39;
    y = 240 - 9 * 24;
  } else {
    if (((location - 1) / 10) % 2) {
      x = (279 - ((location - ((location - 1) / 10) * 10) % 11) * 24);
    } else {
      x = (((location - ((location - 1) / 10) * 10) % 11 - 1) * 24 + 39);
    }
    y = (240 - ((location - 1) / 10) * 24);
  }
  for (int j = -7; j <= 7; j++) {
    for (int i = -7; i <= 7; i++) {
      if (((abs(i) ^ 2) + (abs(j) ^ 2)) <= 49) {
        plot_pixel((i + x + 12), (y - j - 12), colour);
      }
    }
  }
}

